import React, { useState } from 'react';
import '../../App.css';

export default function SignUp() {
  const [numKids, setNumKids] = useState(0);

  const handleChange = (event) => {
    setNumKids(parseInt(event.target.value, 10));
  };

  const handleSubmit = (event) => {
    event.preventDefault();
    // handle form submission here
    console.log(`Number of kids: ${numKids}`);
  };

  return (
    <div>
      <h1 className='sign-up'>pr√©-ins</h1>
      <form onSubmit={handleSubmit}>
        <label htmlFor="kids-input">Number of kids:</label>
        <div>
          <input
            type="radio"
            id="kids-1"
            name="kids"
            value="1"
            checked={numKids === 1}
            onChange={handleChange}
          />
          <label htmlFor="kids-1">1</label>
        </div>
        <div>
          <input
            type="radio"
            id="kids-2"
            name="kids"
            value="2"
            checked={numKids === 2}
            onChange={handleChange}
          />
          <label htmlFor="kids-2">2</label>
        </div>
        <div>
          <input
            type="radio"
            id="kids-3"
            name="kids"
            value="3"
            checked={numKids === 3}
            onChange={handleChange}
          />
          <label htmlFor="kids-3">3</label>
        </div>
        <div>
          <input
            type="radio"
            id="kids-4"
            name="kids"
            value="4"
            checked={numKids === 4}
            onChange={handleChange}
          />
          <label htmlFor="kids-4">4</label>
        </div>
        <div>
          <input
            type="radio"
            id="kids-5"
            name="kids"
            value="5"
            checked={numKids === 5}
            onChange={handleChange}
          />
          <label htmlFor="kids-5">5</label>
        </div>
        <button type="submit">Next</button>
      </form>
    </div>
  );
}
